import React from 'react';
import { Row, Col } from 'react-bootstrap';

import Card from '../../../components/Card/MainCard';

const SamplePage = () => {
    return (
        <React.Fragment>
            <Row>
                <Col md={6} xl={12}>
                    <Card>
                        <Card.Header>
                        </Card.Header>
                    </Card>
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default SamplePage;
